import React, { Component } from "react";
import Base from "../core/Base";

export default class chumma extends Component {
  constructor(props) {
    super(props);
    this.state = {
      radio: "",
    };
  }
  handleChange = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };
  activity = () => {
    return (
      <div className="container-fluid">
        <form onSubmit={this.formSubmit}>
          <div className="radio">
            <label className="text-dark">
              <h3>
                Select Task:{" "}
                <input
                  type="radio"
                  name="radio"
                  value="activity"
                  onChange={this.handleChange}
                />{" "}
                activity{" "}
                <input
                  type="radio"
                  name="radio"
                  value="waiting"
                  onChange={this.handleChange}
                />{" "}
                waiting{" "}
              </h3>
            </label>
          </div>
        </form>
        <h5>selected is :{this.state.radio}</h5>
      </div>
    );
  };

  render() {
    return (
      <Base title="" description="" className="container bg-light p-4">
        <div className="text-center">{this.activity()}</div>
      </Base>
    );
  }
}
